import { useContext, useState } from "react";
import "./style/Predict.css"
import { PredictContext } from "../context/PredictContext";

const Form1 = ({title, value, key, handleChange}) => {

    return (
        <div className="predict_form">
            <p className="predict_content">{title}:</p>
            <input 
                type="text" 
                className="input predict_input" 
                value={value}
                onChange={(e) => handleChange(`${key}`, e.target.value)}
            />
        </div>
    )
}

const Form2 = ({title, value, key, handleChange}) => {
    return (
        <div className="predict_form">
            <p className="predict_content">{title}:</p>
            <div className="center_y predict_type">
                <div className="center_y">
                    <input 
                        type="radio" 
                        name="fever" 
                        value={value}
                        checked={value=="Có"}
                        onChange={() => handleChange(`${key}`, "Có")}
                    />
                    <span className="predict_choose">Có</span>
                </div>
                <div className="center_y">
                    <input 
                        type="radio" 
                        name="fever" 
                        value={value}
                        checked={value=="Không"}
                        onChange={() => handleChange(`${key}`, "Không")}
                    />
                    <span className="predict_choose">Không</span>
                </div>
            </div>
        </div>
    )
}

const Predict = () => {

    const { handlePredict } = useContext(PredictContext)

    const [predict, setPredict] = useState("")
    const [info, setInfo] = useState({
        "age": 18,
        "gender": "Nam",
        "fever": "Có",
        "chestPain": "Có",
        "breath": "Có",
        "cough": "Có",
        "dizzy": "Có",
        "bloodPressure": "",
        "heartRate": ""
    })

    const handleChange = (key, value) => {
        setInfo(prev => ({
            ...prev,
            [key]: value
        }))
    }

    const handleSend = async () => {
        console.log("In")
        const result = await handlePredict(info)
        console.log("Out")
        setPredict(result.predict)
    }

    return (
        <div className="predict_container">
            <div className="space_between">
                <div className="predict_body">

                </div>
                <div className="predict_body">
                    
                    
                    <div className="predict_form">
                        <p className="predict_content">Tức ngực:</p>
                        <div className="center_y predict_type">
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="chestPain" 
                                    value={info.chestPain}
                                    checked={info.chestPain=="Có"}
                                    onChange={() => handleChange("chestPain", "Có")}
                                />
                                <span className="predict_choose">Có</span>
                            </div>
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="chestPain" 
                                    value={info.chestPain}
                                    checked={info.chestPain=="Không"}
                                    onChange={() => handleChange("chestPain", "Không")}
                                />
                                <span className="predict_choose">Không</span>
                            </div>
                        </div>
                    </div>
                    
                    <div className="predict_form">
                        <p className="predict_content">Khó thở:</p>
                        <div className="center_y predict_type">
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="breath" 
                                    value={info.breath}
                                    checked={info.breath=="Có"}
                                    onChange={() => handleChange("breath", "Có")}
                                />
                                <span className="predict_choose">Có</span>
                            </div>
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="breath" 
                                    value={info.breath}
                                    checked={info.breath=="Không"}
                                    onChange={() => handleChange("breath", "Không")}
                                />
                                <span className="predict_choose">Không</span>
                            </div>
                        </div>
                    </div>
                    
                    <div className="predict_form">
                        <p className="predict_content">Ho:</p>
                        <div className="center_y predict_type">
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="cough" 
                                    value={info.cough}
                                    checked={info.cough=="Có"}
                                    onChange={() => handleChange("cough", "Có")}
                                />
                                <span className="predict_choose">Có</span>
                            </div>
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="cough" 
                                    value={info.cough}
                                    checked={info.cough=="Không"}
                                    onChange={() => handleChange("cough", "Không")}
                                />
                                <span className="predict_choose">Không</span>
                            </div>
                        </div>
                    </div>
                    
                    <div className="predict_form">
                        <p className="predict_content">Chóng mặt</p>
                        <div className="center_y predict_type">
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="dizzy" 
                                    value={info.dizzy}
                                    checked={info.dizzy=="Có"}
                                    onChange={() => handleChange("dizzy", "Có")}
                                />
                                <span className="predict_choose">Có</span>
                            </div>
                            <div className="center_y">
                                <input 
                                    type="radio" 
                                    name="dizzy" 
                                    value={info.dizzy}
                                    checked={info.dizzy=="Không"}
                                    onChange={() => handleChange("dizzy", "Không")}
                                />
                                <span className="predict_choose">Không</span>
                            </div>
                        </div>
                    </div>

                </div>

            </div>
            {
                predict!="" &&
                <div className="predict_result">{predict}</div> 
            }

            <button 
                className="button predict_send"
                onClick={handleSend}
            >
                Chuẩn đoán
            </button>
        </div>
    )
}

export default Predict;
